import React from 'react';

class ClickAway extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
        <div id="clickAwayFrame">
                <div className="clickAway1">

                </div>

                <div className="clickAway2">

                </div>

                <div className="clickAway3">

                </div>

                <div className="clickAway4">

                </div>

              <style jsx>
                  {`

                  #clickAwayFrame {
                      position: absolute;
                      top: 1px;
                  }
                  
                  .clickAway1 {
                      position: absolute;
                      height: 100vh;
                      width: 5vw;
                      background-color: red;
                      z-Index: 50;
                  }

                  .clickAway2 {
                    position: absolute;
                    height: 100vh;
                    width: 5vw;
                    background-color: red;
                    z-Index: 50;
                }

                .clickAway3 {
                    position: absolute;
                    height: 20vh;
                    width: 100vw;
                    background-color: red;
                    z-Index: 50;
                }

                .clickAway4 {
                    position: absolute;
                    height: 100vh;
                    width: 5vw;
                    background-color: red;
                    z-Index: 50;
                }
                  
                  `}
              </style>
        </div>
        )
    }
}

export default ClickAway;
